export default (function(a,b,c,d,e,f){return {data:{nt3bFAuDKg:{data:{id:36,attributes:{imdbId:"tt0057812",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjNkNWRmNTAtMmRhZC00OTA1LWJkZTItNDgzMGE4NDdmN2RmXkEyXkFqcGdeQXVyMjI4MjA5MzA@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.2\u002F10"},{Source:"Rotten Tomatoes",Value:"86%"}],item_lang:{data:{id:699,attributes:{title:"7 Faces of Dr. Lao",plot:"An old Chinese gentleman rides into the town of Abalone, Arizona and changes it forever, as the citizens see themselves reflected in the mirror of Lao's mysterious circus of mythical beasts.",slug:"7-faces-of-dr-lao"}}},books:{data:[{id:1873,attributes:{title:c,description:"Abalone, Arizona, is a sleepy southwestern town whose chief concerns are boredom and surviving the Great Depression—that is, until the circus of Dr. Lao arrives and immensely and irrevocably changes the lives of everyone drawn to its tents. Expecting a sideshow spectacle, the citizens of Abalone instead confront and learn profound lessons from the mythical made real—a chimera, a Medusa, a talking sphinx, a sea serpent, witches, the Hound of the Hedges, a werewolf, a mermaid, an ancient god, and the elusive, ever-changing Dr. Lao himself. The circus unfolds, spinning magical, dark strands that ensnare the town’s populace: the sea serpent’s tale shatters love’s illusions; the fortune-teller’s shocking pronouncements toll the tedium and secret dread of every person’s life; sensual undercurrents pour forth for men and women alike; and the dead walk again. Dazzling and macabre, literary and philosophical, The Circus of Dr. Lao has been acclaimed as a masterpiece of speculative fiction and influenced such writers as Ray Bradbury.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=nkcqDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e],firstBook:true,published:"2011-06-01",publisher:f,subtitle:a}},{id:1874,attributes:{title:c,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6qlaAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:b,published:"1946-01-01",publisher:a,subtitle:a}},{id:1875,attributes:{title:c,description:"Abalone, Arizona, is a sleepy southwestern town whose chief concerns are boredom and surviving the Great Depression. That is, until the circus of Dr. Lao arrives and immensely and irrevocably changes the lives of everyone drawn to its tents. Expecting a sideshow spectacle, the citizens of Abalone instead confront and learn profound lessons from the mythical made real--a chimera, a Medusa, a talking sphinx, a sea serpent, witches, the Hound of the Hedges, a werewolf, a mermaid, an ancient god, and the elusive, ever-changing Dr. Lao. The circus unfolds, spinning magical, dark strands that ensnare the town's populace: the sea serpent's tale shatters love's illusions; the fortune-teller's shocking pronouncements toll the tedium and secret dread of every person's life; sensual undercurrents pour forth for men and women alike; and the dead walk again. Dazzling and macabre, literary and philosophical, The Circus of Dr. Lao has been acclaimed as a masterpiece of speculative fiction and influenced such writers as Ray Bradbury. This Bison Frontiers of Imagination edition features a new introduction by noted fantasy writer John Marco and striking illustrations by Boris Artzybasheff from the first edition.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=c5c1t2es3KcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[e],firstBook:b,published:"2002-04-01",publisher:f,subtitle:a}},{id:1876,attributes:{title:"The Circus of Dr. Lao. by Charles G. Finney",description:a,thumbnail:a,authors:[d],firstBook:b,published:"1974-01-01",publisher:a,subtitle:a}},{id:1877,attributes:{title:"The Circus of Dr. Lao \u002FBy Charles G. Finney, with Drawings by Boris Artzybasheff",description:a,thumbnail:a,authors:[d],firstBook:b,published:"1935-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940907126}}("",null,"The Circus of Dr. Lao","Charles Grandison Finney","Charles G. Finney","U of Nebraska Press"))